import React from "react";
import Filter from "./Filter";

const Filters = (props) => {
    return (
        <div className="d-grid gap-2 cmx-autool-2 ">
            <Filter text="Mountains"/>
            <Filter text="Cars"/>
            <Filter text="Nature"/>
            <Filter text="Bikes"/>
            <Filter text="People"/>
            <Filter text="Abstract"/>
        </div>
    );
}

export default Filters;
